import React from "react";
import styled from "styled-components";

const FooterContainer = styled.div`
  width: auto;
  height: auto;
  float: left;
  z-index: 1;
  display: inline-grid;
  grid-column-start: 1;
  grid-column-end: 7;
  color: grey;
  background: rgb(156, 141, 143);
`;

const FooterContents = styled.div`
  width: auto;
  height: auto;
  margin: 30px 40px;
`;

const FooterLinks = styled.div`
  width: auto;
  height: auto;
  text-align: center;
  font-size: 18px;
  color: white;
  text-decoration: none;
  border: none;
  -webkit-text-stroke: 0.4px black;
  &:hover {
    cursor: pointer;
    color: #22d55e;
    -webkit-text-stroke: 0.4px #567568;
  }
`;

const Footer = () => {
  return (
    <FooterContainer>
      <FooterContents>
        <FooterLinks>About us</FooterLinks>
      </FooterContents>
      <FooterContents>
        <FooterLinks>Books</FooterLinks>
      </FooterContents>
    </FooterContainer>
  );
};

export default Footer;
